svg.script:
function resetPopups(){
  document.getElementById("family").style.opacity = 0;
  document.getElementById("motherFriend").style.opacity = 0;
}

function familyClick(){
  resetPopups();
  document.getElementById("family").style.opacity = 1;
}

function motherFriendClick(){
  resetPopups();
  document.getElementById("motherFriend").style.opacity = 1;
}
